import React from 'react';

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    marginLeft: "220px",
    marginTop: "40px",
}

export default class User extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getUser', {method: 'GET'})
            .then(res => res.json())
            .then(items=>this.setState({items}))
    }
    render() {
        const {items} = this.state;
        return (
        <>
            <div style={newblock}>
                <div style={{alignContent: 'center', marginLeft: '200px', marginTop: '20px', fontSize:'1.8em', fontWeight:'bold'}}> This page will hold the information exported from QuickBooks</div>
            </div>
            <div style={{textAlign: 'center', marginTop: '200px', marginLeft: '50px'}}>
                {items.response}
            </div>
        </>
        );
    }
}
